import React, { useState } from "react";
import { Container, Typography, Box, TextField, Button } from "@mui/material";
import { useNavigate } from "react-router-dom";

const SecurityQuestionPage = () => {
  const [answer, setAnswer] = useState("");
  const navigate = useNavigate();

  // Dummy security question (replace with your actual security question logic)
  const securityQuestion = "What is your pet's name?";

  const handleSubmit = (event) => {
    event.preventDefault();
    // Here you would typically validate the answer and then proceed
    console.log("Submitted answer:", answer);
    // For demonstration purposes, let's assume validation is successful
    // Redirect to next page after answering security question
    navigate("/dashboard"); // Replace with your actual next page URL
  };

  return (
    <Container component="main" maxWidth="xs">
      <Box
        sx={{
          display: "flex",
          flexDirection: "column",
          alignItems: "center",
          marginTop: 2,
        }}
      >
        <Typography component="h1" variant="h5">
          Security Question
        </Typography>
        <Typography variant="body1" sx={{ mt: 2 }}>
          {securityQuestion}
        </Typography>
        <Box component="form" noValidate onSubmit={handleSubmit} sx={{ mt: 1 }}>
          <TextField
            variant="outlined"
            margin="normal"
            required
            fullWidth
            id="security-answer"
            label="Answer"
            name="answer"
            autoFocus
            value={answer}
            onChange={(e) => setAnswer(e.target.value)}
          />
          <Button
            type="submit"
            fullWidth
            variant="contained"
            color="primary"
            sx={{ mt: 3, mb: 2 }}
          >
            Submit
          </Button>
        </Box>
      </Box>
    </Container>
  );
};

export default SecurityQuestionPage;
